;require.register("FormsDemo/template.html", function(exports, require, module) {
module.exports = "<h2>forms</h2>\n\n<p>Forms can be generated by passing an object describing the desired fields & properties. Keys prefixed with \"_\" will affect the form itself rather than generating fields. Other keys will map to fields.</p>\n\n<ul>\n\t<li><b>_method</b> - The \"method\" attribute of the form element.</li>\n\t<li><b>_action</b> - The \"action\" attribute of the form element.</li>\n</ul>\n\n<p>Fields are object with 0 or more of the following keys</p>\n\n<ul>\n\t<li><b>name</b> - Field name attribute (key will be used if not provided.)</li>\n\t<li><b>title</b> - Field title (key will be used if not provided.)</li>\n\t<li><b>type</b> - Field Type</li>\n\t<li><b>attrs</b> - Additional attributes for field tag (k/v object)</li>\n</ul>\n\n<p><i>Note: form submisions are disabled in the editor</i></p>\n\n[[basicFormEditor]]\n\n<h3>Field Groupings</h3>\n\n<p>Fields may be grouped with the <b>fieldset</b> field type.</p>\n\n<p>Fieldset definitions may have the following keys in additions to the standard keys:</p>\n\n<ul>\n\t<li><b>children</b> - Array or object listing child field.</li>\n\t<li><b>array</b> - Boolean determining if field names should cascade.</li>\n</ul>\n\n<p>Array field names will appear normal in output JSON but will have their name attributs in the form fieldset[fieldname]. Nested fieldsets can cascade this property to produce names like fieldset[subset][fieldname].</p>\n\n[[groupFormEditor]]\n\n<h3>Traditional Field Types</h3>\n\n<h4>Text Field</h4>\n\n[[textfieldFormEditor]]\n\n<h4>Textarea</h4>\n\n[[textareafieldFormEditor]]\n\n<h4>File Field</h4>\n\n[[filefieldFormEditor]]\n\n<h4>Submit</h4>\n\n[[submitfieldFormEditor]]\n\n<h4>Button</h4>\n\n[[buttonfieldFormEditor]]\n\n<h4>Checkbox Field</h4>\n\n[[checkboxfieldFormEditor]]\n\n<h4>Select Field</h4>\n\n[[selectfieldFormEditor]]\n\n<h4>Radio Button Field</h4>\n\n[[radiofieldFormEditor]]\n\n<h4>Hidden Field</h4>\n\nHidden fields have no user-visible representation. Not even the title will render, but the field will be present.\n\n[[hiddenfieldFormEditor]]\n\n<h4>HTML Field</h4>\n\n[[htmlfieldFormEditor]]\n\n<h3>HTML5 Input Types</h3>\n\nIf the input type is not recognized, it will be passed through and treated like any other input. It is up to the browser at that point to do any specialized rendering and/or validation.\n\n[[html5fieldFormEditor]]\n\n<h3>Custom Fields</h3>\n\n<p>@TODO: Document the custom fields API.</p>\n"
});

